import React from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { Link } from 'react-router-dom';
import { ucitajNastavnika } from '../redux/nastavnici/actions';

const Nastavnik = (props) => {
  const nastavnik = { ime: props.ime, prezime: props.prezime, id: props.id };
  console.log(nastavnik);
  const nastavnici = useSelector((state) => state.nastavnici);
  console.log(123, nastavnici);
  const dispatch = useDispatch();

  return (
    <div>
      <p>
        {props.ime} {props.prezime}
      </p>
      <Link
        to={'/nastavnici/' + props.id}
        onClick={() => {
          dispatch(ucitajNastavnika(props.id));
        }}
      >
        Details
      </Link>
      {nastavnici.items.ime}
    </div>
  );
};

export default Nastavnik;
